    this.state = {
    }
  }

  render() {
    const {product} = this.props;
    return (
      <div className="product-row">
        <img src={product.photo} alt=""/>
        <span className="product-row-data">{product.product}</span>
        <span className="product-row-data">{product.size}</span>
        <span className="product-row-data">{product.quantity}</span>
        <span className="product-row-data">{product.price}</span>
      </div>
    );
  }
}

export default ProductRow;
